import React from "react";
import Comida from "./Comida";
import { DataCarrito } from "./Comida";
import { useState, useEffect } from "react";


const carritoInit=[
    {"id":"",
    "nombre":"",
    "precio":""
}
]

function Carrito(props){


    const [dataCarrito, setDataCarrito]=useState(carritoInit)

    useEffect(async()=> {
    await DataCarrito()},
    []
    );

    const data=DataCarrito();
    

    return (
        <>
        {data.nombre}
     
        </>
    )
}

export default Carrito;
